PC Number: 2014-0610Date: 2014-05-27


	 	 His Excellency the Governor General in Council, on the recommendation of the Minister of Foreign Affairs, pursuant to paragraph 2(a) of the Appropriation Act No. 1, 2014-15, appoints:


 


Shawn Barber as High Commissioner for Canada in the Kingdom of Swaziland, with residence in Maputo;


 


Jeffrey Marder as Ambassador Extraordinary and Plenipotentiary of Canada to the Portuguese Republic; and


 


Shawn Steil as Ambassador Extraordinary and Plenipotentiary of Canada to the Kyrgyz Republic, with residence in Astana.



	 Sur recommandation du ministre des Affaires étrangères et en vertu de l’alinéa 2a) de la Loi de crédits no 1 pour 2014-2015, Son Excellence le Gouverneur général en conseil nomme :


 


Shawn Barber en qualité de haut-commissaire du Canada auprès du Royaume du Swaziland, avec résidence à Maputo;


 


Jeffrey Marder en qualité d’ambassadeur extraordinaire et plénipotentiaire du Canada auprès de la République portugaise;


 


Shawn Steil en qualité d’ambassadeur extraordinaire et plénipotentiaire du Canada auprès de la République kirghize, avec résidence à Astana.
